INSERT INTO `content_pages` (`id`, `title`, `content`, `uri`, `page_type`, `template`) VALUES
(1, 'Chairmans Report', '<h3 class=\"sidebar_title\"><strong>Trustees</strong></h3>\r\n\r\n<p>Zoheir Tyebkhan, M.H. Chairman (February 2017 )<br />\r\nQamar Zaman Minhas Chairman (Until January 2017)<br />\r\nSaeed Uddin, B.B.S., M.H. Hon. Secretary (From February 2017)<br />\r\nL.M. Nizamuddin Hon. Secretary (Until January 2017)<br />\r\nAkil Khan Hon. Treasurer (From February 2017)<br />\r\nAmirali B. Nasir, M.H. Hon. Treasurer (Until February 2017)<br />\r\nAminul Haque Trustee<br />\r\nMuhammad Iqbal&nbsp; Trustee (From February 2017)<br />\r\nMohammad Ishaque Trustee (Until January 2017)</p>\r\n\r\n<h3  class=\"sidebar_title\"><br />\r\n<strong>Observer</strong></h3>\r\n\r\n<p>Nisar Khusro</p>\r\n\r\n<h3  class=\"sidebar_title\"><br />\r\n<strong>Kowloon Masjid Management Committee:</strong></h3>\r\n\r\n<p>H.L. Hei (Coordinator)<br />\r\nM.A.J. Abdul Kareem (Member)<br />\r\nHafiz B.S. Ahmad Salih&nbsp; (Member)<br />\r\nShabir Hussain&nbsp; (Member)<br />\r\nMuhammad Shahid&nbsp; (Member)<br />\r\nBazlul Quader (Member)</p>\r\n\r\n<h3  class=\"sidebar_title\"><br />\r\n<strong>Chai Wan Masjid Management Committee:</strong></h3>\r\n\r\n<p >Mohammad Ishaque (Coordinator)<br />\r\nMa Fung Hing Jamal Loondin (Member)<br />\r\nDil Mohammad (Member)<br />\r\nMuskin Khan (Member)<br />\r\nMaster Rafaqat Ali (Member)<br />\r\nMohammad Irshad (Member)</p>\r\n\r\n<h3  class=\"sidebar_title\"><br />\r\n<strong>Jamia Masjid Management:</strong></h3>\r\n\r\n<p>Zafar Ahmed (Member)</p>\r\n\r\n<h3  class=\"sidebar_title\"><br />\r\n<strong>Muslim Community Kindergarten Management Committee:</strong></h3>\r\n\r\n<p>Aminul Haque (Supervisor &amp; Manager)<br />\r\nTahir Nadeem (School Manager)<br />\r\nKasim Ma Fung Wai (School Manager)<br />\r\nHafeezah Khatoon Khan (School Manager)<br />\r\nAsma Farooq (School Manager)<br />\r\nRizwan Ullah (School Manager)<br />\r\nKhurshid Ahmed Hanafi (School Manager)<br />\r\nMusthafa Hussain Ali (School Manager)<br />\r\nAbuzar Abbasi (School Manager)</p>\r\n\r\n<h3  class=\"sidebar_title\"><br />\r\n<strong>Report of the Incorporated Trustees</strong></h3>\r\n\r\n<p>1. The Incorporated Trustees have pleasure in submitting their annual report together with the audited financial statements for the year ended 31st March 2017.</p>\r\n\r\n<h3  class=\"sidebar_title\"><br />\r\n<strong>Principal Activities</strong></h3>\r\n\r\n<p>1. The Incorporated Trustees maintain five Masajids, respectively, (1) Jamia Masjid, at Shelley Street, Mid-levels, (2) Masjid Ammar &amp; O.R. Sadick Islamic Centre, at Oi Kwan Road, Wanchai, (3) Chaiwan Masjid, at Cape Collinson, Chai Wan on Hong Kong Island, (4) Kowloon Masjid &amp; Islamic Centre, at Nathan Road, Tsim Sha Tsui in Kowloon, and (5) Stanley Masjid 53 Tung Tau Wan Road, Stanley Hong Kong. They are assisted by management committees in the operation of Chaiwan Masjid and Kowloon Masjid and Islamic Centre, while the management of Masjid Ammar and O.R. Sadick Islamic Centre is entrusted to the Islamic Union of Hong Kong. Jamia Masjid is managed by a committee.<br />\r\n2. Following the designation of the Jamia Masjid at Shelly Street, Mid-levels as a Grade 1 Historical Monument by the Antiquities Advisory Board. Phase 1 of the renovation and restoration works funded by the Government of the HKSAR were completed in June 2011 while Phase 2 of the renovation and restoration works approved by the Government&rsquo;s Development Bureau were completed in July 2013.<br />\r\n3. The Incorporated Trustees have also established and operate Madrassahs at each of these Masajids and run a Muslim Community Kindergarten. The latter is managed by a School Management Committee. At present there are about 500 students receiving Islamic Education in all the Madrassahs. Every year many students complete reading of Holy Quran (Nazirah) and some students complete the learning of Holy Quran by heart (Hifz). Holy Quran Completion Ceremony was held in which the graduating students were given certificates and gifts.<br />\r\n4. The Incorporated Trustees also maintain and upkeep two Muslim cemeteries, one is located in Happy Valley and the other is in Chai Wan, for burial of deceased Muslims in Hong Kong.<br />\r\n5. Apart from the ongoing operation and maintenance of these facilities, one of the major activities undertaken is the slope maintenance work in compliance with the Dangerous Hillside Order at Happy Valley Cemetery. The slope stabilization works were completed in February 2016 and approved by the Buildings Department.<br />\r\n6. The Kowloon Masjid Dawah Committee organizes Islamic courses for Muslim and non-Muslims. Recently two Intermediate courses have been completed for nonMuslim and certificates were awarded to participants. This service of conducting Islamic courses will continue on a regular basis.<br />\r\n7. In addition, all the Mosques and in particular, Kowloon Masjid, are a big attraction for visits by educational institutions in Hong Kong such as universities, colleges, schools, high government officials, officials from the Police Force and individuals to understand the basic principles of Islam, its&rsquo; teachings as well as to understand our culture and faith. Our trained Imams looked after them and provided explanations in English and Chinese.<br />\r\n8. We conducted Halal Inspections and issued Halal Certificates as a service to Muslims in Hong Kong and some parts of China. The Halal Certification was carried out under the strict supervision of our Imams. The BOT Halal logo is registered at the Trade Marks Registry of the Intellectual Property Department of the Government of the HKSAR.<br />\r\n9. We welcomed visits from Imams of the two Holy Mosques in Saudi Arabia and other well-known Islamic scholars and personalities who delivered lectures in our Masajids for the benefit of the Muslim Community of Hong Kong.<br />\r\n10. The Board of Trustees maintains cordial and friendly relations with Government Officials and the Police Department of Hong Kong. For many years now, the Secretary for Home Affairs, Commissioner of Police, President of Legco, Consul Generals of numerous countries, Officials from China Government Liaison Office have attended our Iftar Dinner Function during the Holy Month of Ramadan and also visited our Masajids on different occasions.</p>\r\n\r\n<h3  class=\"sidebar_title\"><br />\r\n<strong>Results</strong></h3>\r\n\r\n<p>The operating results for the financial year 2013/14 showed an income of $7,345,963.59 and expenditure of $7,601,843.57 leaving a deficit of $255,789.98.<br />\r\n1. The operating results for the financial year 2016/17 showed an income of $7,969,385.55 and expenditure of $7,940,028.49 leaving a surplus of $29,357.06.<br />\r\n2. Several essential projects, costing millions of dollars were attended by the Trustees in 2016/17.&nbsp; More is impending with our ageing Masajids and cemeteries and the ongoing demand for burial spaces. An urgent appeal is made to all Muslim organizations and individuals for generous support and financial assistance. Without contributions, burial arrangements and provision of services for worship will be affected.</p>\r\n\r\n<h3  class=\"sidebar_title\"><br />\r\n<strong>Acknowledgements</strong></h3>\r\n\r\n<p>1. We gratefully acknowledge the donations from organizations and individuals, among which are the dividends received annually from the Late Allah Ditta&rsquo;s estate and the Trust Fund of Mrs. and Mr. Y.A. Wahab and the monthly contributions from Amusa Trading Company Limited. May Allah reward them for their generosity.<br />\r\n2. We are grateful to the many brothers and sisters who helped as volunteers in functions and activities organized in the Masajids and Islamic centers, to our Imams and Quranic teachers, and to our staff and colleagues for their endeavors and dedication in the past year. We are also grateful to the supervisor, principal, managers and teachers of the Muslim Community Kindergarten who contribute so much towards the education of our young children in their foundation years of education.</p>\r\n\r\n<h3  class=\"sidebar_title\"><br />\r\n<strong>Statement of Interest</strong></h3>\r\n\r\n<p>1. The Incorporated Trustees who served during the year are shown on page 1. No Trustee drew any remuneration nor derived any other financial interests from the transactions of the Incorporated Trustees.</p>\r\n\r\n<p><br />\r\nOn behalf of the Incorporated Trustees of the<br />\r\nIslamic Community Fund of Hong Kong</p>\r\n\r\n<p>Zoheir Tyebkhan, M.H.<br />\r\nChairman</p>\r\n', 'chairmans-report', 'main', 'template_main'),
(3, 'INTRODUCTION', '<h3 class=\"sidebar_title\"><strong>THE INCORPORATED TRUSTEES OF THE ISLAMIC COMMUNITY FUND OF HONG KONG</strong></h3>\r\n\r\n<p>The Government of Hong Kong SAR accepted the Incorporated Trustees of the Islamic Community Fund of Hong Kong as a Charitable Organisation and a Certificate of Incorporation was issued on 1 December 1970. The Incorporated Trustees of the Islamic Community Fund of Hong Kong is generally known among Hong Kong Muslims as &ldquo;The Board of Trustees.&rdquo;<br />\r\nThe Government of Hong Kong SAR recognizes the Board of Trustees (BOT) as the main body representing the interests of the Muslim Community in Hong Kong.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h3 class=\"sidebar_title\"><strong>Constitution</strong></h3>\r\n\r\n<p>The Board consists of 7 members known as the Board of Trustees. These members are from four founding and oldest Muslim Organizations of Hong Kong. The Government of Hong Kong has given land to the BOT for the present 5 Masjids (Mosques) and 2 Muslim Cemeteries.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h3 class=\"sidebar_title\"><strong>Main Functions of Board of Trustees</strong></h3>\r\n\r\n<ul>\r\n	<li>To manage the 5 Masjids</li>\r\n	<li>To mange the 2 Muslim cemeteries</li>\r\n	<li>To manage the Madrassas &amp; Maktabs at our Masjids</li>\r\n	<li>To make all arrangements for funerals and burials of deceased Muslims</li>\r\n	<li>To employ Imams, Quran Teachers, Cemetery and Office Staff</li>\r\n	<li>To announce the dates and days of Muslim festivals e.g. beginning of Ramadan and Eidain</li>\r\n	<li>To buy airtime on Radio and conduct Seher &amp; Iftaar program during Ramadan</li>\r\n	<li>To carryout Halal Inspections and issue Halal Certificates in Hong Kong and some parts of China</li>\r\n	<li>To undertake Dawah work for the Muslims and Non Muslims and carryout any other actions in the general interests of the Hong Kong Muslims and propagation of Islam</li>\r\n	<li>To enhance better understanding among different religious leaders and hold interfaith meetings</li>\r\n	<li>To visit and educate Muslims held in the prison</li>\r\n	<li>To arrange Iftaar for approximately 2,500 people on a daily basis during the month of Ramadan at Kowloon Masjid</li>\r\n</ul>\r\n', 'introduction', 'main', 'template_main'),
(5, 'CONSTITUENT BODIES', '<h3 class=\"sidebar_title\"><strong>BOARD OF TRUSTEES (BOT) CONSTITUENT BODIES</strong></h3>\r\n\r\n<p>Each constituent body (Islamic Union of Hong Kong, Pakistan Association of Hong Kong and The Anjuman-E-Mohammedi (Hong Kong SAR) Trustees Incorporated) nominates two members to the board except one from Indian Muslim Association of Hong Kong.</p>\r\n\r\n<h3 class=\"sidebar_title\"><br />\r\n<strong>ISLAMIC UNION OF HONG KONG (IUHK)</strong></h3>\r\n\r\n<p>The Islamic Union of Hong Kong was founded more than 100 years ago by Muslims from the Subcontinent and the Malay Archipelago whose primary purpose for coming here was to enter into trade and commerce with China. Because of their enthusiastic spirit, they finally settled in Hong Kong to pursue their trading activities.</p>\r\n\r\n<p>Since its establishment as an institution, the Islamic Union has undergone many changes, the last one in 1980 when its Constitution was revised to fulfill the requirements for incorporation as a legal entity under The Companies Ordinance of the Hong Kong Government.</p>\r\n\r\n<p>The Islamic Union has on its membership list over 700 Muslims of different nationalities such as Indians, Pakistanis, Chinese, Malays and British. The non-discriminatory nature of the Union is in line with the teachings of the Holy Qur&rsquo;an which stress that racial discrimination should not be practiced in Islam and which stress also the need for unity among Muslims.</p>\r\n\r\n<p>Up to 1981, the activities of the Muslims were undertaken in old and confined accommodations. However, with a generous endowment from the late Osman Ramju Sadick, the first Islamic Center in Hong Kong was constructed. The Islamic Center is appropriately known as the Osman Ramju Sadick Islamic Centre and is situated at No. 40, Oi Kwan Road, Wanchai, Hong Kong. The land for the Masjid-cum-Islamic Center came from a government grant made in the name of BOT. By a special arrangement between BOT and The Islamic Union of Hong Kong the entire building therein is to be managed by the Islamic Union as a special arrangement under delegated authority from the Incorporated Trustees of the Islamic Community Fund of Hong Kong.</p>\r\n\r\n<p>The Osman Ramju Sadick Islamic Center consists of a praying area on the second floor, separate wuthu/ablution areas for men and women on the first floor, an air-conditioned masjid with two levels (one for men and one for women). A classroom for conducting Qur&rsquo;anic and Arabic lessons on the fourth floor, a Muslim Canteen on the fifth floor, a Community Hall which can be used for prayers and other functions on the sixth floor, a library of over 180 square meters on the sixth floor, a Conference Room, Medical Clinic, General Offices and Imam Room on the seventh floor and an office for the Islamic Youth Association, BOT Management Office on the eighth floor and an open podium of over 150 square meters which is also open for activities.</p>\r\n\r\n<p>The working arms of the Islamic Union also extend to Macau where a small masjid and cemetery is managed by the Macau Muslim Association. The Islamic Union assisted the Association financially so as to enable it to look after the interests of the Macau Masjid and Cemetery and the local Muslim community.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h3 class=\"sidebar_title\"><strong>THE PAKISTAN ASSOCIATION OF HONG KONG</strong></h3>\r\n\r\n<p>The majority of Muslims from the part of the Indo-Pakistan sub-continent which now forms Pakistan came to Hong Kong around 1880 as soldiers in the Hong Kong Singapore Battalion of the British Army. In addition to those who served in the British Army there were some in the police. Others were from Government officers, banks, schools and other private concerns as well as traders.<br />\r\nThe Muslims then found themselves without a club house or a representative body as the Indian Muslim Society had ceased to exist. They themselves formed the Pakistan Muslim Society in 1950. They used to meet in the old Ho Man Tin Mosque.</p>\r\n\r\n<p>The Pakistan Trade Commission opened its office in Hong Kong in 1957 and its first Senior Trade Commissioner played a very important role in uniting the Pakistani community. The Pakistanis officially registered themselves with the Hong Kong Government in 1960 as the Pakistan Association of Hong Kong.</p>\r\n\r\n<p>The Association applied and was granted a plot of land situated at the junction of Gascoigne Road and Wylie Road with a total area of 22,110 sq. ft. to build a club house. The building was completed in 1969 and since then a lot of improvements has been made to the &ldquo;club&rdquo; with the addition of two international standard squash courts which were opened in September 1985.</p>\r\n\r\n<p>A wide variety of activities including celebration of Pakistan Day on 23 March, Independence Day on 14 August and dinner gatherings on the occasions Eidain are held at the club house every year for the benefit of the members. Special arrangements are made during the Holy Month of Ramadan to hold Taravih prayers. The club house also has the honour of hosting functions marking the visits of renowned religious scholars and famous personalities to Hong Kong. Regular activities include meetings of Pakistan Students Association, ladies programs and sports training sessions by the official cricket &amp; hockey teams representing the association in different competitions.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h3 class=\"sidebar_title\"><strong>Anjuman-E-Mohammedi (Hong Kong SAR) Trustees Incorporated</strong></h3>\r\n\r\n<p>One of the four constituent members of the Incorporated Trustees of the Islamic Community Fund of Hong Kong is theAnjuman-E-Mohammedi (Hong Kong SAR) Trustees Incorporated whose members consist of members of the Ismaili Tayyebi Dawoodi sect.<br />\r\nIn the middle of the 19th Century, the Bohras, being traders came with the foreign traders to the shores of China and set up their businesses in the coastal settlements where the foreigners were permitted to trade. Indeed, some of the well established and well known trading firms of Hong Kong still existing today belonging to Dawoodi Bohras trace their establishment from the earliest days of the formation of Hong Kong.</p>\r\n\r\n<p>Whilst the majority of the Bohras reside in the sub-Continent, there is a discernible settlement of Bohras in East Africa, South East Asia, North America and United Kingdom. The immigration of younger Bohras to the latter countries is indicative of the gradual shift from a trading community to a community of professional people such as doctors, engineers, lawyers etc.</p>\r\n\r\n<p>The Bohras have been conscious of their obligation as part of the Muslim Community of Hong Kong and from the very beginning of their existence in Hong Kong have supported the concept of Muslim unity in all its aspects. Though small in number, their community has been a solid pillar of cooperation, unity and advancement of the Muslim Community of Hong Kong.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h3 class=\"sidebar_title\"><strong>INDIAN MUSLIM ASSOCIATION OF HONG KONG</strong></h3>\r\n\r\n<p>It is part of Hong Kong history that the Indian Muslims were in Hong Kong as a division of the British Army at the time of the founding of the Colony in the 19th century. They were followed by and augmented in numbers by the arrivals of traders soon after.<br />\r\nIt was mainly for their religious worship that mosques were built in Tsim Sha Tsui and Ho Man Tin on the Kowloon Peninsula and Stanley on the Hong Kong Island, while the Jamia Masjid at Shelley Street was built by an Indian businessman and philanthropist from Bombay, Haji Mohammed Eshaq in 1905.</p>\r\n\r\n<p>The partition of the Indian sub-continent in 1947 all but obliterated this small, active and illustrious Indian Muslim Community, at least on paper and in statistics, since most of these Muslims acquired a new nomenclature with the establishment of a new Muslim Nation.</p>\r\n\r\n<p>The Indian Muslim Community was reborn in the mid-fifties with the arrival of more Muslim traders from the Indian Republic as well as from Indochina, Singapore, Malaya (now Malaysia), Ceylon (now Sri Lanka), Burma etc. The beginning of the 60s saw the nucleus of these Muslims, most of them settling down in the Tsim Sha Tsui district and a few of them in Happy Valley area on the Hong Kong Island.</p>\r\n\r\n<p>These Muslim businessmen with international dealings were conservative and orthodox by nature. They arranged activities such as the conducting of Rathib, Zikr and Maulud; the initiating of the recital of the entire Holy Qur&rsquo;an at Taraweeh prayers by eloquent Hafiz; the arranging of Iftar during the whole month of Ramadan in conjunction with the local Chinese, Pakistani and Sri Lankan Muslims, contributed in attracting more Muslims to visit the Mosque more frequently. Two learned Imams, Moulvi Haji Yusuf Baquavi (the present Imam) and Haji Syed Yasin Moulana (who passed away in H.K. in 1981) were brought down from India, to lead the five times daily prayers, to hold Qur&rsquo;anic classes for children and to deliver Tarjumathal Qur&rsquo;an, Hadith, Bayaan etc. Initiatives were also taken in organizing the celebration of the birthday of the Holy Prophet Muhammad S.A.W., and in arranging Eid gatherings.</p>\r\n\r\n<p>When the idea of reconstructing the Kowloon Mosque was mooted, the Indian Muslims took major part in this noble cause through the Kowloon Mosque Reconstruction Committee and the Fund Raising Committee; they also contributed generously and wholeheartedly to this cause, individually and collectively. They were also instrumental in collecting substantial funds from various Middle Eastern Countries.</p>\r\n\r\n<p>All this time, the Indian Muslim community did not have any formal organization of their own. Many were in fact, members of the Islamic Union of Hong Kong. But soon the occasion arose for such an official body and THE INDIAN MUSLIM ASSOCIATIQN (JAMAATH) LIMITED was founded and incorporated under the Companies Ordinance in September 1979 as a non-profit making organization. The contribution of the Indian Muslims to the cause of Islam in Hong Kong was duly recognized by brother Muslims and were honoured by being invited to join the Board of Trustees of the Incorporated Trustees of the Islamic Community Fund of Hong Kong.<br />\r\nThe main objectives of the Indian Muslim Association are: To promote Islamic Brotherhood among all Muslims of Hong Kong and abroad; to unite and promote better understanding among the Muslims of Indian origin; to promote Brotherhood with all Indians in Hong Kong and abroad; to assist and co-operate with other organizations like the Incorporated Trustees of the Islamic Community Fund of Hong Kong, the Islamic Union of Hong Kong etc.; to lend support to all Islamic bodies on religious and educational matters; to help the needy people in distress from natural causes or otherwise whatsoever and where so ever regardless of colour, religion or nationality; to promote Islamic and other modern teachings among Muslims; to help set up schools etc., and to help establish scholarship funds for studies where so ever; to set up free or subsidized clinics for all Hong Kong people; to hold Eid celebrations and any other Islamic functions.</p>\r\n\r\n<p>The affairs of the Indian Muslim Association are managed by the Governing Committee which consists of 15 members: a President, three Vice-Presidents, an Honorary Secretary, an Honorary Assistant Secretary, an Honorary Treasurer and 8 other Committee members who are elected annually. The Governing Committee meets once a month to plan, deliberate and execute its stated objectives. The Association, though young, has proved itself once and again to be one of the main pillars of the entire Muslim community of Hong Kong, and will continue to extend its support for the welfare of the Muslims at all times.</p>\r\n\r\n<p>Mention must also be made of all local Muslims, as well as Muslims from Pakistan and Sri Lanka, who have stood shoulder to shoulder in all activities in which the Association has been involved in, without any difference or reservations, proving that Islam does not recognize man-made national boundaries and that our Brotherhood is universal. Thus the Indian Muslims have become an indivisible part of the Hong Kong Muslim Community and will strive with other brethren for the betterment of Muslims, the propagation of Islam and above all, for maintaining the unity of the Brotherhood. Insha Allah.</p>\r\n', 'consitutuent-bodies', 'main', 'template_main'),
(4, 'HISTORY OF MUSLIMS IN HONG KONG', '<p 0px=\"\" color:=\"\" helvetica=\"\" lucida=\"\" margin:=\"\" outline:=\"\" padding:=\"\" style=\"border: 0px; font-family: \" vertical-align:=\"\">Before the Island of Hong Kong was ceded to Britain by the Viceroy at Canton (Guangzhou) in January 1841, Hong Kong was a tiny part of San On District of Kwan Tung Province. At that time the population of the Island was only about five thousand (as compared with 7.5 million today) consisting mostly of farmers and their families living in the valleys, and fishermen living on boats along the sheltered coast.</p>\r\n\r\n<p 1em=\"\" color:=\"\" helvetica=\"\" lucida=\"\" margin:=\"\" outline:=\"\" padding:=\"\" style=\"border: 0px; font-family: \" vertical-align:=\"\">The first British ships to sail into the Chinese waters were those of East India Company (where most of the crew were recruited) from Calcutta in India for trading between the various posts from India to Japan. The East India Company&rsquo;s trade with China reached its peak in the early 19th century and seamen were then mostly signed on from Bombay and Calcutta by the British first opium clipper which was then a wooden boat known as &ldquo;Red River,&rdquo; built by Jardine &amp; Matheson in Calcutta in 1829. Since then it had opened the gate for the early Muslims settling down in Hong Kong.</p>\r\n\r\n<p 1em=\"\" color:=\"\" helvetica=\"\" lucida=\"\" margin:=\"\" outline:=\"\" padding:=\"\" style=\"border: 0px; font-family: \" vertical-align:=\"\">Hong Kong means &ldquo;Fragrant Harbour&rdquo; and the early seamen mostly came from the shores of Malabar (India), Bay of Bengal, Campbellpur (Attock), Hazara (Abbottabad), Lahore, and Gujarat. Besides those others came from Shanghai, Aden (Yemen), Java, Sumatra, Malacca, Malaya (now Malaysia), Sarawak, South-Sea Borneo, Brunei, Port Said (Egypt), Turkey, Zanzibar (Tanzania).</p>\r\n\r\n<p 1em=\"\" color:=\"\" helvetica=\"\" lucida=\"\" margin:=\"\" outline:=\"\" padding:=\"\" style=\"border: 0px; font-family: \" vertical-align:=\"\">With Hong Kong beginning to develop into an important seaport for the British, more and more seamen and garrisons were passing through and some settled here, like Chinese Turkestan, Burmese, Ceylonese, Indo-Chinese, white Russians from both Russia and Harbin, Moros from the South Philippines and Arabs etc.</p>\r\n\r\n<p 1em=\"\" color:=\"\" helvetica=\"\" lucida=\"\" margin:=\"\" outline:=\"\" padding:=\"\" style=\"border: 0px; font-family: \" vertical-align:=\"\">During the early 19th century many Muslim seamen had no proper accommodation or dormitory but somehow or other they managed to stay well-knitted together in an area known as Lower Lascar Row &ndash; in the Central area, better known to the Hong Kong old timers as &ldquo;Moro Kai&rdquo; (streets of the people of the Moros). The Muslim seamen held their first Jamat (gathering) in an open street at Lower Lascar Row, and continued to do so for a time. In those days the non-Muslims never dared to pass through that street after marketing for fear of hurting the Muslims&rsquo; feeling when they held pork and walked along while the Muslims were having their &ldquo;Salat.&rdquo; Years later with hundreds of the Muslims and their families having vacated their shops and residences for elsewhere in Hong Kong, their shops were taken over by Chinese traders selling Curios, Old Scrolls and Relics and these streets of Lower Lascar Row are now better known to many tourists as the &ldquo;Cat Street.&rdquo;</p>\r\n\r\n<p 1em=\"\" color:=\"\" helvetica=\"\" lucida=\"\" margin:=\"\" outline:=\"\" padding:=\"\" style=\"border: 0px; font-family: \" vertical-align:=\"\">With Hong Kong already well established under Britannia more and more Muslims were heading this way from India (principally Punjabis) filling most of the post as Hong Kong Police Constables, Marine Guards, Prison Guards, Dockyard Guards, Watchmen, Bank Clerks, Royal Naval Dockyard Police, Ferry Supervisors, Post Office Mail Launch Guards, Sanitary Foremen and Government Servants. The diamond traders from South India especially Muslims also came in big numbers.</p>\r\n\r\n<p 0px=\"\" 1em=\"\" color:=\"\" helvetica=\"\" lucida=\"\" margin:=\"\" outline:=\"\" padding:=\"\" style=\"border: 0px; font-family: \" vertical-align:=\"\">Today there are more than 300,000 Muslims in Hong Kong, of whom about 30,000 are Chinese, 30,000 are from Pakistan and 150,000 are Indonesians. The others are mostly non-Chinese born in Hong Kong. There are also Muslims from India, Malaysia and Middle Eastern and African countries.</p>\r\n', 'history', 'main', 'template_main'),
(6, 'CONTACT US', '<div class=\"col-md-6\">\r\n<h3 class=\"sidebar_title\"><strong>Board of Trustees Management Office (Head Office)</strong></h3>\r\n\r\n<p>THE INCORPORATED TRUSTEES OF THE ISLAMIC COMMUNITY FUND OF HONG KONG<br />\r\n40 Oi Kwan Road, Wan Chai, Hong Kong<br />\r\nTel: (+852) 2838 9417 &amp; 2893 1051<br />\r\nFax: (+852) 2891 9559<br />\r\nEmail: trustees@netvigator.com</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n\r\n\r\n<h3 class=\"sidebar_title\"><strong>CEMETERIES</strong></h3>\r\n\r\n<p>Happy Valley &amp; Chai Wan Muslim Cemetery&nbsp;&nbsp;<br />\r\nMuslim Cemeteries Management Office<br />\r\nHappy Valley Muslim Cemetery<br />\r\nHau Tak Lane, Happy Valley, Hong Kong<br />\r\nTel: (+852) 2575 2967<br />\r\nFax: (+852) 2574 1040<br />\r\nEmail: hvmc@biznetvigator.com</p>\r\n\r\n<h3 class=\"sidebar_title\"><br />\r\n<strong>HALAL CERTIFICATION</strong></h3>\r\n\r\n<p>BOT Management Office (Head Office)<br />\r\n8/F, Masjid Ammar &amp; O.R.S. Islamic Centre<br />\r\n40 Oi Kwan Road, Wan Chai<br />\r\nTel: (+852) 2893 1051 &amp; 2838 9417<br />\r\nFax: (+852) 2891 9559</p>\r\n\r\n<h3 class=\"sidebar_title\"><strong>Post Office Box Address</strong></h3>\r\n\r\n<p>P. O. Box No. 47206, Morrison Hill Post Office,Wan Chai, Hong Kong<br />\r\nTel: (+852) 2838 9417 &amp; 2893 1051<br />\r\nFax: (+852) 2891 9559<br />\r\nEmail: trustees@netvigator.com</p>\r\n\r\n<p>&nbsp;</p>\r\n<h3 class=\"sidebar_title\"><br />\r\n<strong>MUSLIM COMMUNITY KINDERGARTEN</strong></h3>\r\n\r\n<p>G/F, Masjid Ammar &amp; O.R.S. Islamic Centre<br />\r\n40 Oi Kwan Road, Wan Chai<br />\r\nTel: (+852) 2891 0552 &amp; 2838 9417<br />\r\nFax: (+852) 2116 0763 &amp; 2891 9559<br />\r\nEmail: muslimkg@biznetvigator.com</p>\r\n</div>\r\n\r\n<div class=\"col-md-6\">\r\n<h3 class=\"sidebar_title\"><strong>KOWLOON MASJID &amp; ISLAMIC CENTRE</strong></h3>\r\n\r\n<p>105 Nathan Road, Tsim Sha Tsui, Kowloon, Hong Kong<br />\r\nTel: (+852) 2724 0095<br />\r\nFax: (+852) 2724 2661<br />\r\nEmail: kowloonmosque@gmail.com</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h3 class=\"sidebar_title\"><strong>JAMIA MASJID</strong></h3>\r\n\r\n<p>30 Shelly Street, Central, Hong Kong<br />\r\nTel: (+852) 2523 7743<br />\r\nFax: (+852) 2891 9559<br />\r\nEmail: trustees@netvigator.com</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h3 class=\"sidebar_title\"><strong>MASJID AMMAR</strong></h3>\r\n\r\n<p>40 Oi Kwan Road, Wan Chai, Hong Kong<br />\r\nTel: (+852) 2575 2218<br />\r\nFax: (+852) 2834 5409<br />\r\nEmail: info@iuhk.org</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h3 class=\"sidebar_title\"><strong>CHAI WAN MASJID</strong></h3>\r\n\r\n<p>Cape Collinson Road, Chai Wan,Hong Kong<br />\r\nTel: (+852) 2556 5507<br />\r\nFax: (+852) 2891 9559<br />\r\nEmail: trustees@netvigator.com</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h3 class=\"sidebar_title\"><strong>STANLEY MASJID</strong></h3>\r\n\r\n<p>53 Tung Tau Wan Road,Stanley, Hong Kong<br />\r\nTel: (+852) 2813 7377<br />\r\nEmail: stanleymosquehk@gmail.com</p>\r\n</div>\r\n', 'contact-us', 'main', 'template_main'),
(7, 'KOWLOON MASJID', '\r\n<h3 class=\"sidebar_title\"><strong>KOWLOON MASJID	</strong></h3>\r\n\r\n<p>The Muslim garrison were the pioneers in arranging a place for &ldquo;Salat&rdquo; (worship) while stationing in Kowloon Peninsula, for they requested their superior commanders for a site large enough to hold gatherings of several hundred worshippers especially for the &ldquo;Eid&rdquo; and &ldquo;Juma&rdquo; prayers, and that request was granted to them with a temporary site allotted inside the Whitfield Army Barracks between Austin Road and Nathan Road.</p>\r\n\r\n<p>The first Mosque in the Kowloon Peninsula was built on Nathan Road, Kowloon on a 16,000 sq. ft. (approximately 1,500 sq. m) plot of land in 1896 by the Muslim garrisons of Hong Kong Regiment of the British Army with assistance from their respective commanders for the &ldquo;- Mohammedans of Upper India -&rdquo; who had arrived in Hong Kong on May 7, 1892 to serve in the Regiment and were accommodated in nearby Whitfield Barracks.</p>\r\n\r\n<p>Its foundation stone had the following inscription: &mdash; &ldquo;The Hong Kong Regiment built this Mosque in 1896 under the kind supervision of Col. E. G. Barrow and repaired and repainted by the help and permission of Major Berger in 1902.&rdquo;</p>\r\n\r\n<p>The foundation stone also states that the builder of the Masjid was Mir Asadullah and it was built with the money of the Muslim soldiers. Its Imam was Maulvi Gulab Shah and its renovation was completed on January 22, 1902.</p>\r\n\r\n<p>Besides the Mosque the garrisons also constructed a large concrete pool for storing up water for worshippers to make &ldquo;Wudhu,&rdquo; and water plants and large gold fish were put inside the pool to prevent the water from pollution. Quarters were also erected for the Maulvi and Mussafir Khana (Rest House for wayfarers). The Muslim garrisons also brought their own Maulvi from Campbellpur (Attock) in Pakistan</p>\r\n\r\n<p>It remained a place of worship for the Muslims for over 80 years but in 1976 construction work for a Mass Transit Railway station adjacent to the Masjid caused extensive damage to the building and the Public Works Department declared the building a dangerous structure on October 11, 1978. In anticipation of these developments the Incorporated Trustees had requested Government permission to construct a new Mosque in place of the old one. This permission was granted on December 3, 1977. The plans of the new Mosque were submitted to the Government on July 14, 1978 and approved on October 13, 1978.</p>\r\n\r\n<p>The old Mosque was demolished in January 1980 and construction work on the new Mosque commenced on March 6, 1981. The new Mosque was completed with a total cost of HK$25 million and was opened for daily prayers on Friday, May 11, 1984. It can accommodate 3,500 worshippers. Five times daily prayers are held at the Mosque and large congregations are present during Fridays and Eidain. During the month of Ramadan Travih prayers held and Iftar is arranged for approximately 2,000-2,500 people on a daily basis. Nearly 1 Million people come to the centre every year.</p>\r\n\r\n<p>The building houses three prayer halls, boys &amp; girls madrassas, library and a community hall. The community hall is also used by BOT and other Muslim Organizations to hold their programs on special occasions.</p>\r\n\r\n<p>In the Madrassas the Holy Quran is taught to the students, Arabic is taught as a language. Students are also taught Quran in English and Urdu. Dawah Courses (Intermediate Course on Islam) for Non Muslims are held on a regular basis.</p>\r\n\r\n<p>In 2004 &amp; 2005 the Kowloon Masjid &amp; Islamic Centre was renovated with a cost of HK$14 million and the facilities were extended to include a library, conference room, management office, two (2) office rooms for Imams and a big kitchen. The old ablution area on the mezzanine floor was converted into two (2) new Madrassas for girls and boys. The new madrassas are centrally air-conditioned and can easily accommodate up to 200 students each. On Fridays it is also used for the Jumma prayer congregation.</p>\r\n\r\n<p>Located at 105 Nathan Road, today the Kowloon Masjid and Islamic Centre, with its distinctive white marble finish, is a major landmark in Tsim Sha Tsui and a true identity of the Muslim Community in Hong Kong.</p>\r\n', 'kowloon-masjid', 'main', 'template_sidebar'),
(8, 'CHAI WAN MASJID\r\n', '<h3><strong>CHAI WAN MASJID (CAPE COLLINSON MOSQUE)</strong></h3>\r\n\r\n<p>In order to compensate for the resumption of a cemetery and a small Mosque in Ho Man Tin on the Kowloon Peninsula in 1963, the Government provided land for a cemetery in Cape Collinson, Chai Wan.</p>\r\n\r\n<p>The Government also constructed a small Mosque in Cape Collinson, Chai Wan which opened on August 4, 1963 and was primarily used for the purpose of offering Janazah prayers. Initially regular prayers were not held especially because it was an isolated area and no Muslims lived there except for a caretaker. As more and more Muslim families settled in Chai Wan they started offering their daily prayers at Chai Wan Masjid. Holy Quran is also taught to children in the Madrassa after school hours every day. The Trustees have renovated the entire building in 2005 and air-condition has been installed in the main prayer hall.</p>\r\n\r\n<p>The Mosque is surrounded by mountains &amp; rich greenery and enjoys a quiet &amp; peaceful environment. Outside the prayer hall is an open space suitable for small religious gatherings.</p>\r\n\r\n<p>The Advisory Board of Antiques &amp; Monuments Office designated Chai Wan (Cape Collinson Mosque) as a Grade 3 historic building on 17 May 2010.</p>\r\n', 'chai-wan-masjid', 'main', 'template_sidebar'),
(9, 'Jamia Masjid', '<h3 class=\"sidebar_title\"><strong>Jamia Masjid is the first Masjid in Hong Kong. </strong></h3>\r\n\r\n<p>According to the official records at Antiquities and Monuments Office the Muslim Mosque known as Lascar temple was built in 1849. This is the first mosque in Hong Kong. The Mosque is of rectangular shape with an arched main entrance and arched windows of Arabic style on all sides. Extension of the Mosque took place in 1915, and the pillar was retained.</p>\r\n\r\n<p>Minutes of the Executive Council Meeting held on 25 October 1844 contains the earliest record regarding Jamia Mosque. Some of the few Muslim firms from the Indian Subcontinent who established their businesses in Hong Kong in 1841, applied to the Government for building a mosque in Hong Kong to fulfil the religious needs of the Muslims who were growing in number.</p>\r\n\r\n<p>An indenture note issued by the Supreme Court of Hong Kong on 23rd September, 1850 states that the Jamia Mosque land was officially registered in 1850 and the Incorporated Trustees of the Islamic Community Fund also formed in 1850 became its management organization.</p>\r\n\r\n<p>All other records pertaining to the Mosque were destroyed during the Japanese occupation of Hong Kong during World War II (1939-1945). However, it is a fact that Muslim troops of the Indian Army, forming a large portion of Hong Kong&rsquo;s garrison, arrived in Hong Kong in 1842. Some Muslim businessmen from India, Shanghai and other areas arrived soon afterwards.</p>\r\n\r\n<p>The treaty for the 46,860 sq. ft. plot of land was granted on December 23, 1850. The lease is for a period of 999 years effective December 3, 1849, the date of the Treaty states the land was occupied and the first Mosque must have been constructed upon it soon afterwards.</p>\r\n\r\n<p>This Mosque was demolished in 1915 and the foundation stone of the present Mosque was laid on 3rd Shawwaal 1333 Hijri (Augast 15, 1915) by Nakoda Suliman Curim Mohamed. The entire cost of the new Mosque was paid by Haji Mohamed Essack Elias of the Memon Community, Bombay, India. Its Architect was Mr. A. Abdool Rahim.</p>\r\n\r\n<p>The Mosque is approximately 70 ft. long, 40 ft. wide and 20 ft. high. It has a portico with a minaret above. Despite its age, the Mosque is structurally stable and more than 400 people can offer their prayer inside the hall.</p>\r\n\r\n<p>Jamia Mosque was awarded the status of Grade 1 in the list of Hong Kong&rsquo;s historical buildings by the Government of Hong Kong SAR in May 2010. Major repair and renovation works have been carried out by the Board of Trustees with generous financial assistance from the Hong Kong Government&rsquo;s Development Bureau in 2011-12 and 2012-13.</p>\r\n\r\n<p>Five times prayers are held at the Mosque and there is a large congregation on Fridays and Eidain. During the month of Ramadan Travih prayers are held and Iftar is also served.</p>\r\n\r\n<p>&nbsp;</p>\r\n', 'jamia-masjid', 'main', 'template_sidebar'),
(10, 'MASJID AMMAR', '<h3 class=\"sidebar_title\"><strong>MASJID AMMAR &amp; OSMAN RAMJU SADICK ISLAMIC CENTER </strong></h3>\r\n\r\n<p>The old Muslim Cemetery in Hong Kong was located at 7, Seymore Street, (near the Jewish Synagogue) where only 5 or 6 burials took place before it was resumed. A new cemetery was then provided in Happy Valley where the earliest grave dates back to 1828. A small Mosque was constructed adjoining the cemetery mainly to hold Janazah Prayers. With the increase in Muslim population on Hong Kong Island, Muslims living close by began to use the Mosque for daily prayers as well. A new and larger Mosque was constructed after World War II which remained in use until December 1978 when it was resumed by Government to construct approach roads for the Aberdeen Tunnel.</p>\r\n\r\n<p>As compensation the Government provided a plot of land located at 40 Oi Kwan Road in Wan Chai, and paid $2.5 million towards the re-provisioning for a new Mosque. The construction work commenced in September 1979 and an eight storey building has been constructed with funds being provided by the Islamic Union of Hong Kong and completed in 1981. The new building &lsquo;Masjid Ammar &amp; Osman Ramju Sadick Islamic Centre&rsquo; was formally opened on September 14, 1981.</p>\r\n\r\n<p>The property is owned by the Incorporated Trustees of the Islamic Community Fund of Hong Kong which has given its management to the Islamic Union of Hong Kong who look after the Masjid &amp; Islamic Centre and cater to the needs of the Muslim Community. It contains a Mosque on the second floor with ablution facilities for men and women on the first floor. Five times prayers are held in the Mosque. A prayer hall for ladies is located on the third floor. Floors four to eight provide administrative and communal facilities including classrooms, Islamic canteen, library, offices for Imams &amp; Qur&rsquo;an teacher and Islamic organizations, conference and seminar rooms and a medical clinic. Muslim Community Kindergarten is located on the ground floor. The Centre can accommodate more than 1500 people.</p>\r\n\r\n<p>&nbsp;</p>\r\n', 'masjid-ammar', 'main', 'template_sidebar'),
(11, 'STANLEY MOSQUE', '<h3 class=\"sidebar_title\"><strong>STANLEY MOSQUE </strong></h3>\r\n\r\n<p style=\"border: 0px; font-family: &quot;Helvetica Neue&quot;, Helvetica, Arial, &quot;Lucida Grande&quot;, sans-serif; margin: 0px 0px 1em; outline: 0px; padding: 0px; vertical-align: baseline; color: rgb(68, 68, 68);\">In the early part of this century there were some 400 Muslims from Indian sub-continent working in the Hong Kong Prisons Department. In the beginning their Headquarters were in Arbuthnot Road/Victoria Prison area which is quite close to Shelly Street where there existed a Mosque where they could pray.</p>\r\n\r\n<p style=\"border: 0px; font-family: &quot;Helvetica Neue&quot;, Helvetica, Arial, &quot;Lucida Grande&quot;, sans-serif; margin: 1em 0px; outline: 0px; padding: 0px; vertical-align: baseline; color: rgb(68, 68, 68);\">However, in the 1930&rsquo;s some of them were moved to Stanley where a new prison complex was constructed. Although at that time there existed places of worship including churches &amp; temples for believers of other religious faiths but no Mosque was present for the Muslims to offer their daily prayers. The Muslims made a request to the Prison authorities who provided a piece of land where they started offering their daily prayers. Later a Mosque was built at the same place which opened on January 1, 1937. Stanley Mosque is a result of the dedication and hard work of the Muslims who not only made financial contributions towards the construction of the Mosque but also assisted the construction workers in their off duty hours. Their untiring efforts reflect their loyalty to Allah Almighty.</p>\r\n\r\n<p style=\"border: 0px; font-family: &quot;Helvetica Neue&quot;, Helvetica, Arial, &quot;Lucida Grande&quot;, sans-serif; margin: 1em 0px; outline: 0px; padding: 0px; vertical-align: baseline; color: rgb(68, 68, 68);\">The Mosque is located at 53 Tung Tau Wan Road inside the restricted area at Stanley Prison. It is a beautiful little Mosque with a fairly large prayer hall, has a veranda and a courtyard. The Correctional Services Department of HKSAR kindly permits the use of the Mosque especially on Fridays or other special occasions by Muslims other than its own staff.</p>\r\n\r\n<p style=\"border: 0px; font-family: &quot;Helvetica Neue&quot;, Helvetica, Arial, &quot;Lucida Grande&quot;, sans-serif; margin: 1em 0px 0px; outline: 0px; padding: 0px; vertical-align: baseline; color: rgb(68, 68, 68);\">The Advisory Board of Antiques &amp; Monuments Office designated Stanley Mosque as a Grade 1 historic building on 18 December 2009.</p>\r\n\r\n<p>&nbsp;</p>\r\n', 'stanaley-mosque', 'main', 'template_sidebar'),
(12, 'KOWLOON MASJID (KM)', '<p><img alt=\"\" src=\"https://bot.islamictrusthk.org/assets/content_files/20230320102835484150png.png\" /></p>\r\n\r\n<p>105 Nathan Road, Tsim Sha<br />\r\nTsui, Kowloon Hong Kong<br />\r\nTel: (+852) 2724 0095<br />\r\nFax: (+852) 2724 2661<br />\r\nEmail: kowloonmosque@gmail.com</p>\r\n', 'kowloon-masjid-sidebar', 'sidebar', ''),
