INSERT INTO `content_pages` (`id`, `title`, `content`, `uri`, `page_type`, `template`) VALUES
(22, 'CEMETERIES', '<p>There are at present 2 Muslim CEMETERIES in Hong Kong, one in Happy Valley and the other one in Chai Wan. Both CEMETERIES are managed by the Incorporated Trustees of the Islamic Community Fund of Hong Kong.</p>\r\n\r\n<h3><strong>Happy Valley Muslim Cemetery</strong></h3>\r\n\r\n<p>According to official Government burial records available with the Food and Environmental Hygiene Department the first burial at Happy Valley Muslim Cemetery was done in 1828. On 15 July 1870 a deed of appropriation was issued under the British rule stating that &ldquo;a piece of ground situated on the west side of Wong-Nei-Chung Valley and registered in the Land Office as Inland Lot Number 288 by the name of &lsquo;the Mussulman Cemetery&rsquo; will be exclusively used by the Mussulman Community for the purpose of a Mussulman Cemetery.&rdquo;<br />\r\nHappy Valley Muslim Cemetery is also listed on Common Wealth Grave&rsquo;s Commission and contains 6 burials from First World War and 19 from the Second World War.</p>\r\n\r\n<h3><br />\r\n<strong>Chai Wan Muslim Cemetery</strong></h3>\r\n\r\n<p>The Chai Wan Muslim Cemetery in Cape Collinson was established in 1963 and is a relatively new cemetery as compared to Happy Valley Muslim Cemetery. Its distinctive feature is its lush green mountainous surroundings and a Masjid where five times daily prayers are offered.</p>\r\n\r\n<p>Both CEMETERIES are private; and neither one of them has gardens or parklands. The maintenance of both CEMETERIES is solely by the Board of Trustees and the cost of maintenance is borne entirely by the Trustees through burial fees.</p>\r\n\r\n<p>The maintenance work comprises keeping clean and safe all the pathways, repairs and maintenance of slopes within the CEMETERIES, and clearing natural vegetation as and when required.</p>\r\n\r\n<p>The Advisory Board of Antiques &amp; Monuments Office designated Chai Wan Cemetery (Cape Collinson Cemetery) as a Grade 3 historic site on 17 May 2010.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<div>Download Form:<span style=\"white-space:pre\"> </span> Cemeteries Burial Guidance Note</div>\r\n\r\n<div>Download Form:<span style=\"white-space:pre\"> </span>Cemeteries Burial Charges</div>\r\n\r\n<div>Download Form:<span style=\"white-space:pre\"> </span>Cemeteries Contractors List</div>\r\n\r\n<div>For more information please Contact:</div>\r\n\r\n<div>&nbsp;</div>\r\n\r\n<h3><strong>Muslim Cemeteries Management Office</strong></h3>\r\n\r\n<div>Happy Valley Muslim Cemetery,</div>\r\n\r\n<div>Hau Tak Lane, Happy Valley, Hong Kong</div>\r\n\r\n<div>Tel: (+852) 2575 2967</div>\r\n\r\n<div>Fax: (+852) 2574 1040</div>\r\n\r\n<div>Email: hvmc@biznetvigator.com</div>\r\n', 'cemeteries', 'main', 'template_sidebar'),
(23, 'HAPPY VALLEY MUSLIM CEMETERY (HVMC)', '<p><img alt=\"\" src=\"https://bot.islamictrusthk.org/assets/content_files/20230320101548269805jpg.jpg\" /></p>\r\n\r\n<p>Hau Tak Lane, Happy Valley, Hong Kong<br />\r\nTel: (+852) 2575 2967<br />\r\nFax: (+852) 2574 1040<br />\r\nEmail: hvmc@biznetvigator.com</p>\r\n', 'HAPPY VALLEY MUSLIM CEMETERY (HVMC)', 'sidebar', ''),
(24, 'CHAI WAN MUSLIM CEMETERY (CWMC)', '<p><img alt=\"\" src=\"https://bot.islamictrusthk.org/assets/content_files/2023032010162083964jpg.jpg\" />​</p>\r\n\r\n<p>Cape Collinson Road, Chai Wan, Hong Kong<br />\r\nTel: (+852) 2575 2967<br />\r\nFax: (+852) 2574 1040</p>', 'CHAI WAN MUSLIM CEMETERY (CWMC)', 'sidebar', ''),
(25, 'DONATE GENEROUSLY', '<div class=\"kode_client_text\">\r\n<p class=\"qurantextstyle\">The Holy Quran says:&ldquo;Those who spend their wealth [in Allah&rsquo;s way] by night and by day,secretly and publicly-they will have their reward with their Lord. And no fear will there beconcerning them, nor will they grieve.&rdquo;</p>\r\n\r\n<h6>(Surah Al-Baqarah 2:274)</h6>\r\n</div>\r\n\r\n<p>The Incorporated Trustees of the Islamic Community Fund of Hong Kong (Board of Trustees) maintain 5 main Masjids (Mosques) &amp; 2 Muslim cemeteries in Hong Kong. We make arrangements for daily prayers and manage all the Islamic events. We also make Janazah (Burial) arrangements for deceased Muslims. The Board of Trustees does not receive any financial assistance/grant from the Government of HKSAR or any other organization. We meet our expenses through donations. Alhamdulillah many brothers and sisters in Islam are regularly donating towards the Trust Fund and some have kept a provision in the will of their trusts to continue their financial contribution after they have left this world, which is known in Islam as Sadqa-e-Jaria (ceaseless charity).</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<div class=\"row\">\r\n<div class=\"col-md-6\">\r\n<h3><strong>YOU CAN DONATE TOWARDS</strong></h3>\r\n\r\n<ul>\r\n	<li>Zakat, Fitrah and Sadaqah</li>\r\n	<li>Repair &amp; Maintenance Expenses of Masjids (Mosques)</li>\r\n	<li>Repair &amp; Maintenance Expenses of Muslim Cemeteries</li>\r\n	<li>Dawah Courses for awareness of New &amp; Non-Muslims</li>\r\n	<li>Teaching Holy Quran in Madrassa</li>\r\n	<li>Burial Expenses of Deceased Muslims without family/heirs</li>\r\n	<li>Arrangements for Iftar in the Holy Month of Ramadan</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n</div>\r\n\r\n<div class=\"col-md-6\">\r\n<h3><strong>CASH DONATIONS CAN BE MADE AT THE FOLLOWING LOCATIONS&nbsp;</strong><br />\r\n(receipt will be issued)</h3>\r\n\r\n<ul>\r\n	<li>Board of Trustees Management Office, 8/F, 40 Oi Kwan Road, Wan Chai, HK</li>\r\n	<li>Kowloon Masjid &amp; Islamic Centre, 105 Nathan Road, Tsim Sha Tsui, Kowloon, HK</li>\r\n	<li>Jamia Masjid, 30 Shelly Street, Mid-levels, Central, HK</li>\r\n	<li>Chai Wan Masjid, Cape Collinson Road, Chai Wan, HK</li>\r\n	<li>Stanley Masjid, 53 Tung Tau Wan Road, Stanley, HK</li>\r\n</ul>\r\n</div>\r\n</div>\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h3><strong>YOU CAN ALSO MAKE A DONATION BY SENDING A CROSSED CHEQUE MADE OUT IN FAVOUR OF</strong></h3>\r\n\r\n<br />\r\n&ldquo;THE INCORPORATED TRUSTEES OF THE ISLAMIC COMMUNITY FUND OF HONG KONG&rdquo; and mail it to: Board of Trustees Management Office, 8/F, 40 Oi Kwan Road, Wan Chai, Hong Kong. Please write down purpose of the donation at the back of the cheque along with your contact details so your donation can be acknowledged by mail along with a receipt.\r\n\r\n<p>Note: The Incorporated Trustees of the Islamic Community Fund of Hong Kong is an approved Charitable Trust under Section 88 of Inland Revenue Department. All donations of HK$100 are tax deductible and donors can claim tax exemption.</p>\r\n\r\n', 'donation', 'main', 'template_main');
